from typing import List


def remove_duplicates(numbers: List[int]) -> List[int]:
    """ From a list of integers, remove all elements that occur more than once.
    Keep order of elements left the same as in the input.
    >>> remove_duplicates([1, 2, 3, 2, 4])
    [1, 3, 4]
    """
    l = len(numbers)
    if l == 0:
        return numbers
    duplicates = set(numbers)
    if l < 2:
        return [(numbers[i], numbers[i]) for i in range(0, l)]
    ordered = []
    for i in range(0, l):
        if duplicates.intersection(numbers[i]):
            ordered.append((numbers[i], numbers[i]))
        else:
            ordered.append(numbers[i])
    return sorted(ordered, key=lambda x: x[1])[:l]

