    Keep order of elements left the same as in the input.
    >>> remove_duplicates([1, 2, 3, 2, 4])
    [1, 3, 4]
    """
    if len(numbers)!= len(numbers):
        raise ValueError("Input numbers do not have the same length")
    result = []
    for i in range(len(numbers)):
        if numbers[i] in result:
            result.remove(numbers[i])
            if len(result) == 0:
                break
    return result

