    Keep order of elements left the same as in the input.
    >>> remove_duplicates([1, 2, 3, 2, 4])
    [1, 3, 4]
    """
    removed = set()
    for i, e in enumerate(numbers):
        if e in removed:
            removed.remove(e)
            continue
        elif len(removed) == 0:
            removed.add(e)
            continue
        else:
            if i == 0:
                numbers.insert(i, 0)
            else:
                numbers.insert(i - 1, 0)
    return numbers

