        return numbers
    if numbers[0] == numbers[-1] == numbers[0]:
        return numbers
    elif len(numbers) == 1:
        return numbers
    else:
        nums = []
        for i in range(len(numbers) - 1, 0, -1):
            nums.append(numbers[i])
        nums.append(numbers[-1])
        return list(remove_duplicates(nums))

